<?xml version="1.0" encoding="UTF-8" standalone="yes"?>
<html>
    <head>
        <meta content="text/html; charset=UTF-8" http-equiv="content-type"/>
        <title></title>
        <style>/*<![CDATA[*/
            p {
            font-size:10;
            }
            
            p.ReportTitle {
            font-family: "Times New Roman", Times, serif;
            font-size: 20pt;
            font-weight:bold;
            margin-bottom:12pt;
            }
            
            p.Author, p.Date, p.ReportSubtitle{
            margin:0pt;
            }
            
            p.ReportSectionHeading, .ReportSectionHeading {
            font-family: "Times New Roman", Times, serif;
            font-size: 12pt;
            font-weight: bold;
            width:100%;
            border-top:1pt solid;
            padding-top:6pt;
            }
            
            p.SectionTitle {
            font-family: "Times New Roman", Times, serif;
            font-size: 9pt;
            font-weight: bold;
            padding-top:6pt;
            }
            
            p.BlockSectionTitle {
            font-weight: bold;
            }
            
            table {
            table-layout:fixed;
            border-collapse:collapse;
            border-spacing:0;
            word-wrap: break-word;
            }
            
            table > tbody > tr:nth-child(even) {
            background-color:#eee;
            }
            
            table > tbody > tr:nth-child(odd) {
            background-color:#fff;
            }
            
            td p {
            margin:0;
            }
            
            span.Parameters{
            margin:0;
            padding-left:36pt;    
            }
            
            table.EnvironmentInfoTable {
            width:auto;
            }
            
            span.EnvironmentName{
            font-weight:bold;
            }
            
            span.FilterSummarySectionHeader{
                font-weight:bold;
            }
            
            span.FilterSummarySectionContent{
                
            }

            span.FilterAppendixFilterName{
                font-weight:bold;
            }
            
            thead.FilterDetailsTable{
                font-weight:bold;
                 border-bottom: 1px solid;
            }
            
            span.FileInfoName {
            font-weight:bold;
            }
            
            table.FileInfoTable> thead {
            font-weight:bold;
            }
            table.FileInfoTable {
            width:100%;
            }
            
            table.DiffTable > tbody > tr:nth-child(even) {
                background-color:#fff;
            }
            
            tr.subsystem_node_path {
               font-weight:bold;
            }
            
            table.DiffTable {
            width:100%;
            padding-bottom:6pt;
            }
            
            table.SubsystemTitle {
            border: 1px solid black;
            }
            
            tr.nodes > td {
            padding-top:12pt;
            border-bottom:1pt solid black;
            }
            
            hr.DiffSeparator {
                border-color: #E5E5E5;
                border-style: solid;
                border-width: 1pt;
            }
            
        /*]]>*/</style>
    </head>
    <body>              
        <p class="ReportTitle"><form class="Hole"><label for="ReportTitle">ReportTitle</label><input id="ReportTitle"></input></form></p>
        <p class="ReportSubtitle"><form class="Hole"><label for="ReportSubtitle">ReportSubtitle</label><input id="ReportSubtitle"></input></form></p>        
        <p class="Author"><form class="Hole"><label for="ReportCreator">ReportCreator</label><input id="ReportCreator"></input></form></p>
        <p class="Date"><form class="Hole"><label for="ReportDate">ReportDate</label><input id="ReportDate"></input></form></p>
        
        <p class="ReportSectionHeading"><form class="Hole"><label for="FileInfoTitle">FileInfoTitle</label><input id="FileInfoTitle"></input></form></p>
        <div><form class="Hole"><label for="FileInformation">FileInformation</label><input id="FileInformation"></input></form></div>
        
        <p class="ReportSectionHeading"><form class="Hole"><label for="EnvironmentInfoTitle">EnvironmentInfoTitle</label><input id="EnvironmentInfoTitle"></input></form></p>
        <div><form class="Hole"><label for="EnvironmentInformation">EnvironmentInformation</label><input id="EnvironmentInformation"></input></form></div>
        
        <p class="ReportSectionHeading"><form class="Hole"><label for="FiltersSummaryTitle">FiltersSummary</label><input id="FiltersSummaryTitle"></input></form></p>
        <div id="filters"><form class="Hole"><label for="FiltersSummary">FiltersSummary</label><input id="FiltersSummary"></input></form></div>
        
        <p class="ReportSectionHeading"><form class="Hole"><label for="DifferencesTitle">DifferencesTitle</label><input id="DifferencesTitle"></input></form></p>
        <div><form class="Hole"><label for="ComparisonDiffs">ComparisonDiffs</label><input id="ComparisonDiffs"></input></form></div>
                
        <p class="ReportSectionHeading"><form class="Hole"><label for="FiltersAppendixTitle">FiltersAppendixTitle</label><input id="FiltersAppendixTitle"></input></form></p>
        <div><form class="Hole"><label for="FiltersAppendix">FiltersAppendix</label><input id="FiltersAppendix"></input></form></div>
    </body>
</html>
